window.bookSummaryJSON = "<p>Complete Quests. Earn Renown. Win.</p> <p>Meet Alexander Krup, your average high school graduate turned video game beta tester. Working for a strange company nobody has ever heard of, he earns his pay by the achievement.</p> <p>After a string of bad luck, including his girlfriend dumping him, he wakes up one seemingly average day and is suddenly faced with blue boxes of text that float in the air. While coming to grips with the fact that he might by hallucinating, a representative of his mysterious employer communicates through the menu boxes to offer a fresh life in another world.</p> <p>With nothing left to lose, Alexander takes the offer and is sent hurtling into a fantasy world both like and unlike any game he's played before.</p> <p>Now, he must choose an alignment.</p> <p>Will he seek Renown or Infamy? One way or another, Alex will leave a markâ€¦ or will it be a stain?</p> <p>Don't miss this exciting new LitRPG Adventure from Kos Play, author of the System School Series. Join Alex as he rises from zero-to-hero in a new world filled with monsters, a detailed system, magic, power progression, and so much more!</p>"; 
